import React from 'react'

const Dashboard = () => {
    return (
        <div>
            <img src='https://www.myfitnesspal.com/_next/image?url=%2F_next%2Fstatic%2Fmedia%2Fhero-collage-top-large%402x.dcc5ac56.png&w=1200&q=75' alt="photo" width="100%"/>
            <div>
            <h1 style={{position:"absolute",left:"200px",top:"150px",fontSize:"75px",fontWeight:"500",width:"500px",textAlign:"left"}}>Fitness starts with what you eat.</h1>
            </div>
           
        </div>
    )
}

export default Dashboard
